import Vue from 'vue';
import VueRouter from 'vue-router';

// Importation des composants
import Accueil from '@/views/Accueil.vue';
import Serveurs from '@/views/Serveurs.vue';

Vue.use(VueRouter);

const routes = [
  {
    path: '/',
    name: 'Accueil',
    component: Accueil
  },
  {
    path: '/serveurs',
    name: 'Serveurs',
    component: Serveurs
  }
];

const router = new VueRouter({
  mode: 'history',
  routes
});

export default router;
